import React from 'react'
import { Button, Card } from '@blueprintjs/core'

export default function list(props) {
    return (
        <div>
    <Card>
      <h5>{props.item.text}</h5>
      <p>Assigned to: {props.item.assignee}</p>
      <p>Difficulty: {props.item.difficulty}</p>
      <p>Complete: {props.item.complete.toString()}</p>
      {!props.item.complete && (<Button onClick={() => props.toggleComplete(props.item.id)}>Mark Complete</Button>)}
      {' '}<Button onClick={() => props.deleteItem(props.item.id)}>Delete</Button>
    </Card>
        </div>
    )
}
